const propTypes = {
    ...SectionProps.types
  }

  const defaultProps = {
    ...SectionProps.defaults
  }

  const Shop = ({
    className,
    topOuterDivider,
    bottomOuterDivider,
    topDivider,
    bottomDivider,
    hasBgColor,
    invertColor,
    ...props
